import classes from "./User.module.css";
import { List } from "semantic-ui-react";

const User = (props) => {
  return (
    <li className={classes.user}>
      <div>
        <img src={props.profilepic} alt={props.name} />
        <h3>{props.username}</h3>
        <div className={classes.description}>{props.bio}</div>
        <List.Item icon="marker" content={props.location} />
        <div className={classes.description}>{props.name}</div>
        {!props.mail && <div className={classes.price}>{props.mail}</div>}
        {props.mail && <p>Not mentioned</p>}
      </div>
    </li>
  );
};

export default User;
